css:
.header{
background: #000000;
}
.header__nav a{
color: #ffffff;
}
.header__nav a:hover{
background: #444444;
}
.header__toggler-icon{
color: #f7f7f7;
}
.header__submenu {
  max-width: none;
  min-width: 100%;
  left: 0%;
  gap: var(--spacer-1);
  margin-top: var(--spacer-2);
  grid-template-columns: repeat(auto-fit, minmax(15%, 1fr)); 
}

.fas.fa-search{
color: #ffffff;
}

.app__header{
background: #000000;
}
.app__header{
color: #ffffff;
}
.app__contact{
color: #ffffff;
}
.app__contact span:not(:first-child){
color: #ffffff;
}

a{
color: #000000;
}

li.breadcrumb-item > a{
color: #000000;
}

.card-header{
color: #000000;
}
.card-header:hover{
color: #000000;
}

.top-bar{
  background: #2b2b2b;
}
.top-bar__nav{
  color: #f7f7f7;
}

body{
background: #ffffff;
}

.product-card__buy.fade {
opacity: 1 !important;
}
.products-carousel, .products-carousel__title span,.products-carousel__title a{
background: #ffffff;
}
.product-card__name{
color: #000000;
}
.product-card__name {
  font-weight: bold;
  font-size: 0.9rem
}
.product-card section {
  border: 1px solid #f7f7f7;
  padding: 10px
}

.footer{ 
background: #000000;
}
.footer a, .footer__store, .footer__tittle, .footer__title{
color: #f7f7f7;
}
.footer{
color: #cccccc;
}

.menu{
background: #2b2b2b;
}
.menu__item{
color: #ffffff;
}
.menu__footer i{
color: #f7f7f7;
}
.menu__link{
color: #e3e3e3;
}
.menu__link:hover{
color: #f7f7f7;
}
.menu__list{
color: #bfff00;
}
.menu__item:hover{
background: #474747;
}

.info-bar{
color: #ffffff;
}
.info-bar{
background: #000000;
}
@media (min-width: 576px){
.info-bar{
    max-width: 100%;
    max-height: calc
}
}

.btn-block{
background: #000000;
}
.btn-block:hover{
background: #008b00;
}
.btn-block{
color: #ffffff;
}
.btn-primary{
background: #000000;
}
.btn-primary:hover{
background: #008b00;
}
.btn-primary{
color: #ffffff;
}

.badge{
background: #474747;
}
@media (min-width: 576px){
.banner-slider{
    max-width: 100%;
    max-height: calc(100rem*var(--banner-aspect-ratio))
}
}

.i-arrow-left{
color: #e3e3e3;
}
.i-times{
color: #e3e3e3;
}
.i-user{
color: #f7f7f7;
}
.i-shopping-bag{
color: #f7f7f7;
}
.i-instagram{
color: #f7f7f7;
}
.i-whatsapp{
color: #bfff00;
}

.pay-icon--visa {
background-image: url(/img/uploads/visa.png);
background-size: 100% 100%;
}
.pay-icon--mastercard {
background-image: url(/img/uploads/master.png) !important;
background-size: 100% 100%;
background-position: 0
}
.pay-icon--hipercard {
background-image: url(/img/uploads/hipercard.png) !important;
background-size: 100% 100%;
background-position: 0
}
.pay-icon--elo {
background-image: url(/img/uploads/elo.png);
background-size: 100% 100%;
background-position: 0
}
.pay-icon--amex {
background-image: url(/img/uploads/american.png) !important;
background-size: 100% 100%;
background-position: 0
}
